const FetchApi = (url, path, data) => {
    let urls =  path
    let option = {
        method: "POST",
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json'
        },
        body: JSON.stringify(data)
    }
    return fetch('​http://183.88.219.85:3000/employee_regit', option)
        .then(res => res.json())
        .then(res => {
            return res
        })
        .catch(err => {
            throw err
        })
}

